import React from "react";
import logo from "../images/logo/header-logo.svg";
import blackLogo from "../images/"

function Header() {
  return (
    <header className="header">
      <img alt="Логотип проекта - Mesto Russia." className="logo" src={logo}/>
    </header>
  );
}

export default Header;
